const long long MOD = 1e9 + 7;
const long long MAXN = 1e6 + 1;
using namespace std;

typedef long long ll;
typedef pair<int, int> pii;


long long readInt() {
    bool minus1 = false;
    long long result = 0;
    char ch;
    ch = getchar();
    while (true) {
        if (ch == '-') break;
        if (ch >= '0' && ch <= '9') break;
        ch = getchar();
    }
    if (ch == '-') minus1 = true; else result = ch-'0';
    while (true) {
        ch = getchar();
        if (ch < '0' || ch > '9') break;
        result = result*10 + (ch - '0');
    }
    if (minus1)
        return -result;
    else
        return result;
}
vector<int> g[MAXN];
int used[MAXN];


int main() {
	#ifdef IZI_KATKA
	assert(freopen("input", "r", stdin));
    assert(freopen("output", "w", stdout));
    #endif
    int n = readInt(), m = readInt();
    for (int i = 1; i <= m; i++) {
    	int u = readInt(), v = readInt();
    	g[u].pb(v);
    	g[v].pb(u);
    }
    deque <int> ans;
    ans.pb(1);
    used[1] = 1;
    while(true) {
    	bool ok = 0;
    	int k = ans[0];
    	for (int i : g[k]) {
			if (!used[i]) {
				ans.push_front(i);
				used[i] = 1;
				ok = 1;
				break;
			}
		}
		if (ok) {
			continue;
		}
		k = ans[ans.size() - 1];
    	for (int i : g[k]) {
			if (!used[i]) {
				ans.pb(i);
				used[i] = 1;
				ok = 1;
				break;
			}
		}
		if (ok) {
			continue;
		}		
		break;
    }
    cout << ans.size() << endl;
    for (int i = 0; i < ans.size(); i++) {
    	cout << ans[i] << ' ';
    }
    return 0;
}